const traductions = {
  FR: {
    auth: "Authentifiez-vous pour accéder à la calculette",
    connect: "Bonjour et bienvenue sur le site.",
    txt: "Découvrez nos fonctionnalités et nos services !",
  },
  EN: {
    auth: "Authenticate yourself to access the calculator",
    title: "Hello and welcome to the site.",
    txt: "Discover our features and services!",
  },
};

export default traductions;
